import React from "react";
import {
  FormControl,
  // Menu,
  Text,
  Select,
  FormLabel,
  Flex,
  Box,
} from "@chakra-ui/react";

const FilterComponent = () => {
  return (
    <>
      <Box>
        <SortComponent />
      </Box>
    </>
  );
};

export default FilterComponent;

const SortComponent = () => {
  return (
    <>
      <FormControl>
        <Box display="flex" alignItems="center" rounded={'md'} border="1px solid lightgrey" p=".5rem">
          <Text>Sort By :</Text>
          <select border="none" outline="none" padding=".5rem">
            <option border="none" bg="transparent"> High to Low</option>
            <option border="none" bg="transparent"> Low to High</option>
            <option border="none" bg="transparent">Rating</option>
          </select>
        </Box>
      </FormControl>
    </>
  );
};
